A basic query has the following form: query { entity { field_1 field_2 ... } ...
} The entity field corresponds to the name of an entity defined in your schema and the sub-fields are the fields defined on that entity type; entities and fields are stored in the database using the names defined in the schema, so make sure that your query uses those same names as well. query { block { id height timestamp }
} We're requesting the ID, height, and timestamp for each block stored in the backend. If successful, the API server will return a response similar to the following: [ { "height" : 1, "id" : "f169a30cfcbf1eebd97a07b19de98e4b38a4367b03d1819943be41744339d38a", "timestamp" : 1668710162 }, { "height" : 2, "id" : "a8c554758f78fe73054405d38099f5ad21a90c05206b5c6137424985c8fd10c7", "timestamp" : 1668710163 }, { "height" : 3, "id" : "850ab156ddd9ac9502768f779936710fd3d792e9ea79bc0e4082de96450b5174", "timestamp" : 1668710312 }, { "height" : 4, "id" : "19e19807c6988164b916a6877fe049d403d55a07324fa883cb7fa5cdb33438e2", "timestamp" : 1668710313 }, { "height" : 5, "id" : "363af43cfd2a6d8af166ee46c15276b24b130fc6a89ce7b3c8737d29d6d0e1bb", "timestamp" : 1668710314 }
