The @indexed directive adds a database index to the underlying column for the indicated field of that type. Generally, a database index is a data structure that allows you to quickly locate data without having to search each row in a database table. type Book @entity { id: ID! name: Bytes8! @indexed
} type Library @entity { id: ID! book: Book!
} In this example, a single BTREE INDEX constraint will be created on the book table's name column, which allows for faster lookups on that field. Important: At the moment, database index constraint support is limited to BTREE in Postgres with ON DELETE, and ON UPDATE actions not being supported.

62.body:
The @unique directive adds a UNIQUE database constraint to the underlying database column for the indicated field of that type. A constraint specifies a rule for the data in a table and can be used to limit the type of data that can be placed in the table. In the case of a column with a UNIQUE constraint, all values in the column must be different. type Book @entity { id: ID! name: Bytes8! @unique
} type Library @entity { id: ID! book: Book!
} A UNIQUE constraint will be created on the book table's name column, ensuring that no books can share the same name. Important: When using explict or implicit foreign keys, it is required that the reference column name in your foreign key relationship be unique. ID types are by default unique, but all other types will have to be explicitly specified as being unique via the @unique directive.

63.body:
The @join directive is used to relate a field in one type to others by referencing fields in another type. You can think of it as a link between two tables in your database. The field in the referenced type is called a foreign key and it is required to be unique. type Book @entity { id: ID! name: Charfield! @unique
} type Library @entity { id: ID! book: Book! @join(on:name)
} A foreign key constraint will be created on library.book that references book.name, which relates the Books in a Library to the underlying Book table. For more info on what exactly is happening here, please see the Relationships section.

66.body:
type Library @entity { id: ID! name: Charfield!
} type Book @entity { id: ID! library: Library!
} Given the above schema, two entities will be created: a Book entity, and a Library entity. As you can see, we add the Book entity as an attribute on the Library entity, thus conveying that we want a one-to-many or one-to-one relationship between Library and Book. This means that for a given Book, we may also fetch the associated Library entity. It also means that the field Book.library will be an ID scalar type that references Library.id.

67.body:
type Library @entity { id: ID! name: Charfield! @unique
} type Book @entity { id: ID! library: Library! join(on:name)
} For the most part, this works the same way as implicit foreign key usage. However, as you can see, instead of implicitly using Library.id as the reference column for our Library field type on the Book object, we're explicitly specifying that we want Library.name to serve as our foreign key for the Book.library field. Also, please note that since we're using Library.name in our foreign key constraint, that column is required to be unique (via the @unique directive).

