First, let's create a Sway contract with some simple types. contract; use std::logging::log; struct Addition { added_value: u64, updated_total: u64,
} struct Subtraction { subtracted_value: u64, updated_total: u64,
} abi ValueStore { #[storage(read, write)] fn add(value: u64); #[storage(read, write)] fn subtract(value: u64) -> Subtraction;
} storage { total: u64 = 1000,
} impl ValueStore for Contract { #[storage(read, write)] fn add(value: u64) { let updated_total = storage.total.read() + value; storage.total.write(updated_total); log( Addition { added_value: value, updated_total } ) } #[storage(read, write)] fn subtract(value: u64) -> Subtraction { let updated_total = storage.total.read() - value; storage.total.write(updated_total); Subtraction { subtracted_value: value, updated_total } }
} In this contract, we have two types: Addition and Subtraction. As we'll soon see, indexers can process custom types that are logged or returned as part of a function. To begin creating an indexer for this contract, let's build the contract and generate a JSON ABI file. Running forc build generates a JSON ABI similar to the lightly-edited one below: { "types": [ { "typeId": 0, "type": "()", "components": [], "typeParameters": null }, { "typeId": 1, "type": "struct Addition", "components": [ { "name": "added_value", "type": 3, "typeArguments": null }, { "name": "updated_total", "type": 3, "typeArguments": null } ], "typeParameters": null }, { "typeId": 2, "type": "struct Subtraction", "components": [ { "name": "subtracted_value", "type": 3, "typeArguments": null }, { "name": "updated_total", "type": 3, "typeArguments": null } ], "typeParameters": null }, { "typeId": 3, "type": "u64", "components": null, "typeParameters": null } ], "functions": [...], "loggedTypes": [ { "logId": 0, "loggedType": { "name": "", "type": 1, "typeArguments": [] } } ], "messagesTypes": [...], "configurables": [...]
