Finally, we can create handlers to index these particular types and store them in the database. Let's look at the following example: use fuel_indexer_utils::prelude::*; #[indexer(manifest = "indexer.manifest.yaml")]
mod indexer_mod { fn index_addition(addition_event: Addition) { let addition = AddEntity { id: 123, value: addition_event.added_value, updated_total: addition_event.updated_total }; addition.save(); } fn index_subtraction(subtraction_event: Subtraction) { let subtraction = SubtractEntity { id: 123, value: subtraction_event.subtracted_value, updated_total: subtraction_event.updated_total }; subtraction.save(); }
} Regardless of whether a custom type was logged (e.g. Addition) or returned (e.g. Subtraction), the type will be available for you to use in your functions. Just include the type(s) you want your function to use in the parameters, and the function will be executed whenever each of the parameters have been satisfied by an instance of the type(s).
